package de.muenchen.pdfdemo;

import org.apache.commons.io.IOUtils;
import org.junit.jupiter.api.Test;
import org.springframework.boot.test.context.SpringBootTest;

import java.io.IOException;
import java.io.InputStream;
import java.nio.file.Files;
import java.nio.file.Paths;

public class PdfServiceTests {

    private PdfService service = new PdfService();

    @Test
    public void testSimpleHtml() throws IOException {
        byte[] bytes = this.service.createPdf(this.createSampleHtml());
        Files.write(Paths.get("sample.pdf"), bytes);
    }

    @Test
    public void testMustacheTemplate() throws IOException {
        BelastungsplanPdf bean = new BelastungsplanPdf();
        bean.setTitle("Belastungsplan - ZÃ¤hlstelle 123456");
        // SVG
        bean.setChart(this.getSampleSvg());
//        bean.setChart("data:image/gif;base64,");
        String html = this.service.createDiagramFile(bean);
        byte[] bytes = this.service.createPdf(html);
        Files.write(Paths.get("belastungsplan.pdf"), bytes);
    }

    private String createSampleHtml() {
        return "<html><head>" +
                "<bookmarks>" +
                "<bookmark name=\"foo\" href=\"#foo\"/>" +
                "<bookmark name=\"bar\" href=\"#bar\"/>" +
                "</bookmarks>" +
                "<style>body {font-family: 'Roboto';}</style>" +
                "</head>" +
                "<body>" +
                "<h2 id=\"foo\">Foo</h2>" +
                "<h2 id=\"bar\">Bar</h2>" +
                "</body>" +
                "</html>";
    }

    private String getSampleSvg() throws IOException {
        InputStream is = getClass().getResourceAsStream("/charts/sample_svg.base64");
        String svg = IOUtils.toString(is);
        return svg;
    }

}
